  self.priority_groups_compute_node_membership = function () {
    var pg_nodesets = [];
    _.each(self.defined_priority_groups, function (g) {
      pg_nodesets.push([g.name, g.createdBy == _cdcCreatedBySystem, new Set(_.map(g.nodes, function (n) {
        return n.name;
      }))]);
    });
    var pg_enum = ["Yes (dx12 months)", "Yes (12<dx 36 months)", "Yes (dx>36 months)", "No"];
    _.each({
      subcluster_or_priority_node: {
        depends: [timeDateUtil._networkCDCDateField],
        label: _cdcPOImember,
        enum: pg_enum,
        type: "String",
        volatile: true,
        color_scale: function color_scale() {
          return d3.scale.ordinal().domain(pg_enum.concat([_networkMissing])).range(["red", "orange", "yellow", "steelblue", _networkMissingColor]);
        },
        map: function map(node) {
          var npcoi = _.some(pg_nodesets, function (d) {
            return d[1] && d[2].has(node.id);
          });
          if (npcoi) {
            var cutoffs = [_n_months_ago(self.get_reference_date(), 12), _n_months_ago(self.get_reference_date(), 36)];

            //const ysd = self.attribute_node_value_by_id(
            //  node,
            //  "years_since_dx"
            //);

            if (self._filter_by_date(cutoffs[0], timeDateUtil._networkCDCDateField, self.get_reference_date(), node, false)) return pg_enum[0];
            if (self._filter_by_date(cutoffs[1], timeDateUtil._networkCDCDateField, self.get_reference_date(), node, false)) return pg_enum[1];
            return pg_enum[2];
          }
          return pg_enum[3];
        }
      },
      cluster_uid: {
        depends: [timeDateUtil._networkCDCDateField],
        label: "Clusters of Interest",
        type: "String",
        volatile: true,
        map: function map(node) {
          var memberships = _.filter(pg_nodesets, function (d) {
            return d[2].has(node.id);
          });
          if (memberships.length == 1) {
            return memberships[0][0];
          } else {
            if (memberships.length > 1) {
              return "Multiple";
            }
          }
          return "None";
        }
      },
      subcluster_id: {
        depends: [timeDateUtil._networkCDCDateField],
        label: "Subcluster ID",
        type: "String",
        //label_format: d3.format(".2f"),
        map: function map(node) {
          try {
            return node.subcluster_label ? node.subcluster_label : "None";
          } catch (err) {}
          return _networkMissing;
        }
      }
    }, self._aux_populated_predefined_attribute);
    self._aux_populate_category_menus();
  };
  self.priority_groups_add_set = function (nodeset, update_table, not_validated, prior_name, op_code) {
    function check_dup() {
      if (nodeset.name[0] == " " || nodeset.name[nodeset.name.length - 1] == " ") {
        alert("Cluster of interest '" + nodeset.name + "' has spaces either at the beginning or end of the name. Secure HIV-TRACE does not allow names that start or end with spaces.");
        return true;
      }
      var my_nodes = new Set(_.map(nodeset.nodes, function (d) {
        return d.name;
      }));
      return _.some(self.defined_priority_groups, function (d) {
        if (d.nodes.length == my_nodes.size) {
          var same_nodes = d.nodes.filter(function (x) {
            return my_nodes.has(x.name);
          }).length == d.nodes.length;
          if (same_nodes && d.tracking == nodeset.tracking) {
            alert("Cluster of interest '" + d.name + "' has the same set of nodes and the same growth criterion as this new cluster of interest. Secure HIV-TRACE does not allow creating exact duplicates of clusters of interest.");
            return true;
          } else if (same_nodes) {
            var keep_duplicate = confirm("Warning! Cluster of interest '" + d.name + "' has the same set of nodes as this cluster of interest, but a different growth criterion'. Click 'OK' to create, or 'Cancel' to abort.");
            var is_duplicate = !keep_duplicate;
            return is_duplicate;
          }
        }
        return false;
      });
    }
    op_code = op_code || "insert";
    if (not_validated) {
      self.priority_groups_validate([nodeset]);
    }
    if (prior_name) {
      var prior_index = _.findIndex(self.defined_priority_groups, function (d) {
        return d.name == prior_name;
      });
      if (prior_index >= 0) {
        if (prior_name != nodeset.name) {
          self.priority_groups_update_node_sets(prior_name, "delete");
          op_code = "insert";
        }
        self.defined_priority_groups[prior_index] = nodeset;
      } else {
        if (check_dup()) return false;
        self.defined_priority_groups.push(nodeset);
      }
    } else {
      if (check_dup()) return false;
      self.defined_priority_groups.push(nodeset);
    }
    self.priority_groups_update_node_sets(nodeset.name, op_code);
    if (update_table) {
      self.draw_priority_set_table();
    }
    return true;
  };
  self.priority_groups_edit_set_description = function (name, description, update_table) {
    if (self.defined_priority_groups) {
      var idx = _.findIndex(self.defined_priority_groups, function (g) {
        return g.name == name;
      });
      if (idx >= 0) {
        self.defined_priority_groups[idx].description = description;
        self.priority_groups_update_node_sets(name, "update");
        if (update_table) {
          self.draw_priority_set_table();
        }
      }
    }
  };
  self.priority_groups_remove_set = function (name, update_table) {
    if (self.defined_priority_groups) {
      var idx = _.findIndex(self.defined_priority_groups, function (g) {
        return g.name == name;
      });
      if (idx >= 0) {
        self.defined_priority_groups.splice(idx, 1);
        self.priority_groups_update_node_sets(name, "delete");
        if (update_table) {
          self.draw_priority_set_table();
        }
      }
    }
  };
