  self.priority_set_editor = null;
  self.priority_set_view = function (priority_set, options) {
    options = options || {};
    var nodes = priority_set.node_objects || priority_set.network_nodes;
    var current_time = timeDateUtil.getCurrentDate();
    var edge_length = options["priority-edge-length"] || self.subcluster_threshold;
    var reference_date = options["timestamp"] || self.today;
    var title = options["title"] || "clusterOI " + priority_set.prior_name;
    var node_dates = {};
    if (priority_set.nodes) {
      _.each(priority_set.nodes, function (nd) {
        node_dates[nd.name] = nd.added;
      });
    } else {
      _.each(priority_set.network_nodes, function (nd) {
        node_dates[nd.id] = nd["_priority_set_date"];
      });
    }
    var nodeDates = {};
    if (options.priority_set && options.priority_set.nodes) {
      _.each(options.priority_set.nodes, function (d) {
        nodeDates[d.name] = d.added;
      });
    }
    _.each(nodes, function (d) {
      //console.log (d);
      d.priority_set = 1;
      d._added_date = d.id in nodeDates ? nodeDates[d.id] : d._priority_set_date;
      if (d._added_date) d._added_date = _defaultDateViewFormatSlider(d._added_date);else d._added_date = null;
    });
    var pgDates = _.sortBy(_.keys(_.groupBy(nodes, function (d) {
      return d._added_date;
    })));
    var node_set = _.flatten(hivtrace_cluster_depthwise_traversal(json["Nodes"], json["Edges"], function (e) {
      return e.length <= edge_length;
    }, null, nodes));
    var refDate = _defaultDateViewFormat(reference_date);
    var dco = "fee8c8fdbb84e34a33";
    var defColorsOther = d3.scale.ordinal().range(_.map(_.range(0, dco.length, 6), function (d) {
      return "#" + dco.substr(d, 6);
    }));
    var maxColors = 4;
    var dcpg = "7b3294c2a5cfa6dba0008837";
    var defColorsPG = d3.scale.ordinal().range(_.map(_.range(0, dcpg.length, 6), function (d) {
      return "#" + dcpg.substr(d, 6);
    }));
    var viewEnum = [];
    var dateID = {};
    _.each(pgDates, function (d, i) {
      if (d) {
        if (pgDates.length > maxColors) {
          if (i < pgDates.length - maxColors) {
            dateID[d] = 0;
            return;
          } else {
            if (i == pgDates.length - maxColors) {
              dateID[d] = viewEnum.length;
              viewEnum.push("In cluster of interest (added on or before " + d + ")");
              return;
            }
          }
        }
        dateID[d] = viewEnum.length;
        viewEnum.push("In cluster of interest (added " + d + ")");
      }
    });
    var priorityColorOffset = viewEnum.length;
    viewEnum.push("Diagnosed and in network before " + refDate);
    viewEnum.push("Diagnosed or in network on or after " + refDate + " [directly linked to cluster of interest]");
    viewEnum.push("Diagnosed or in network on or after " + refDate + " [indirectly linked to cluster of interest]");
    var viewEnumMissing = [].concat(viewEnum, [_networkMissing]);
    var viewEnumMissingColors = _.map(viewEnumMissing, function (d, i) {
      if (d != _networkMissing) {
        if (i < priorityColorOffset) {
          return defColorsPG(d);
        }
        return defColorsOther(d);
      }
      return "gray";
    });
    var subcluster_view = self.view_subcluster(-1, node_set, title, {
      skip_recent_rapid: true,
      init_code: function init_code(network) {
        _.each(network.json.Edges, function (e) {
          var other_node = null;
          if (network.json.Nodes[e.target].priority_set == 1) {
            other_node = network.json.Nodes[e.source];
          } else {
            if (network.json.Nodes[e.source].priority_set == 1) {
              other_node = network.json.Nodes[e.target];
            }
          }
          if (other_node && other_node.priority_set != 1) {
            other_node.priority_set = 2; // directly linked to a priority set node
          }
        });
      },

      "computed-attributes": {
        date_added: {
          depends: [timeDateUtil._networkCDCDateField],
          label: "Date added to cluster of interest",
          type: "Date",
          map: function map(node) {
            return node.id in node_dates ? node_dates[node.id] : _networkMissing;
          }
        },
        priority_set: {
          depends: [timeDateUtil._networkCDCDateField],
          label: "Cluster of Interest Status",
          enum: viewEnum,
          type: "String",
          map: function map(node) {
            //console.log ("PS", node.id, node.priority_set);
            if (node.priority_set == 1) {
              if (node._added_date) {
                return viewEnum[dateID[node._added_date]];
              }
              return viewEnum[0];
            }
            if (self._filter_by_date(reference_date, timeDateUtil._networkCDCDateField, current_time, node, true)) {
              if (node.priority_set == 2) {
                return viewEnum[priorityColorOffset + 1];
              } else {
                return viewEnum[priorityColorOffset + 2];
              }
            }
            return viewEnum[priorityColorOffset];
          },
          color_scale: function color_scale() {
            return d3.scale.ordinal().domain(viewEnumMissing).range(viewEnumMissingColors);
          }
        }
      }
    }, null, null, edge_length).handle_attribute_categorical("priority_set");
    _.each(nodes, function (d) {
      delete d.priority_set;
    });
  };
