  function stratify(array) {
    if (array) {
      var dict = {},
        stratified = [];
      array.forEach(function (d) {
        if (d in dict) {
          dict[d] += 1;
        } else {
          dict[d] = 1;
        }
      });
      for (var uv in dict) {
        stratified.push([uv, dict[uv]]);
      }
      return stratified.sort(function (a, b) {
        return a[0] - b[0];
      });
    }
    return array;
  }
